import React, { useEffect, useState } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import './TableGastos.css';
import axios from 'axios';

function createData(nome, desc, valor) {
    return {nome, desc, valor};
}

const TableGastos = () => {

    const [gastos, setGastos] = useState([]);

    async function fetchGastosAxios () {
        try {
            const {data:response} = await axios.get('http://localhost:8080/api');
            setGastos(response);
        }
        catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        fetchGastosAxios();
    }, []);

    return (
            <TableContainer component={Paper}>
                <Table sx={{minWidth: 650}} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell><b>Nome</b></TableCell>
                            <TableCell align="right"><b>Descrição</b></TableCell>
                            <TableCell align="right"><b>Valor</b></TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {gastos.map((gasto) => {
                            console.log(gastos);
                            console.log("esse", gasto.nome);
                            return (
                            <TableRow
                                key={gasto.nome}
                                sx={{'&:last-child td, &:last-child th': {border: 0}}}
                            >
                                <TableCell component="th" scope="row">
                                    {gasto.nome}
                                </TableCell>
                                <TableCell align="right">{gasto.desc}</TableCell>
                                <TableCell align="right">{gasto.valor}</TableCell>
                            </TableRow>
                            );
                        })}
                    </TableBody>
                </Table>
            </TableContainer>
    );
};

export default TableGastos;
